  summary: "Udostępnia odbiornika, który przekierowuje wszystkie śledzenie i debugowanie dane wyjściowe do [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infrastruktury."
  remarks: "Klasa IisTraceListener łączy mechanizm śledzenia [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] do [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)]. Ta klasa odbiornika umożliwia deweloperom, którzy tworzą [!INCLUDE[vstecasp](~/add/includes/vstecasp-md.md)] aplikacji i który implementuje <xref:System.Web.IHttpModule>i <xref:System.Web.IHttpHandler>interfejsów w celu podniesienia poziomu strony, poziom modułu lub poziom obsługi zdarzenia [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] infrastruktury, gdy śledzenie jest włączone.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule>      > [!NOTE] > Tej klasy odbiornika nie może kierować [!INCLUDE[iisver](~/add/includes/ajax-current-ext-md.md)] zdarzenia do klasy ASP.NET. Dotyczy to również <xref:System.Web.UI.Page>Klasa i klasy, które implementują <xref:System.Web.IHttpModule>lub <xref:System.Web.IHttpHandler>interfejsu.</xref:System.Web.IHttpHandler> </xref:System.Web.IHttpModule> </xref:System.Web.UI.Page>       IisTraceListener została wprowadzona w systemie [!INCLUDE[net_v35_long](~/add/includes/ajax-current-ext-md.md)]. Aby uzyskać więcej informacji, zobacz [wersje i zależności](~/add/includes/ajax-current-ext-md.md)."
